// qasm3LexerInit initializes any static state used to implement qasm3Lexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// Newqasm3Lexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func Qasm3LexerInit() {
	staticData := &Qasm3LexerLexerStaticData
	staticData.once.Do(qasm3lexerLexerInit)
}

// Newqasm3Lexer produces a new lexer instance for the optional input antlr.CharStream.
func Newqasm3Lexer(input antlr.CharStream) *qasm3Lexer {
	Qasm3LexerInit()
	l := new(qasm3Lexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &Qasm3LexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "qasm3Lexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

